import React from "react";
import {Navbar, Nav} from 'react-bootstrap';

import "../css/navbar.css"

export default class NavBar extends React.Component {
  constructor(){
    super();
    this.state= {
      activeTab: "1"
    }

    this.changeTab = this.changeTab.bind(this);

  }

  changeTab = (id) => {
    this.setState({
      activeTab: id
    })
    console.log(this.state.activeTab);
  }

  render() {
    return (
      <div>
        <Navbar collapseOnSelect expand="lg" bg= "dark" variant="dark" className = "navbar navbar-static-top">
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav variant = "pills" className="mr-auto" activeKey = {this.state.activeTab} >
              <Nav.Item>
                <Nav.Link eventKey = "1" href="/" onClick = {this.changeTab.bind(this, "1")}>Home</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey = "2" href="/images" onClick = {this.changeTab.bind(this, "2")}>Images</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey = "3" href="/media" onClick = {this.changeTab.bind(this, "3")}>Media</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey = "4" href="/projects" onClick = {this.changeTab.bind(this, "4")}>Projects</Nav.Link>
              </Nav.Item>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}
